\">\u041a\u0430\u0440\u043b XII<\/a> \u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%B2%D0%B3%D1%83%D1%81%D1%82_%D0%A1%D0%B8%D0%BB%D1%8C%D0%BD%D1%8B%D0%B9\" title=\"\u0410\u0432\u0433\u0443\u0441\u0442 \u0421\u0438\u043b\u044c\u043d\u044b\u0439\">\u0410\u0432\u0433\u0443\u0441\u0442 \u0421\u0438\u043b\u044c\u043d\u044b\u0439<\/a> \u043f\u043e\u0434\u043f\u0438\u0441\u044b\u0432\u0430\u044e\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D0%BB%D1%8C%D1%82%D1%80%D0%B0%D0%BD%D1%88%D1%82%D0%B5%D0%B4%D1%82%D1%81%D0%BA%D0%B8%D0%B9_%D0%BC%D0%B8%D1%80\" title=\"\u0410\u043b\u044c\u0442\u0440\u0430\u043d\u0448\u0442\u0435\u0434\u0442\u0441\u043a\u0438\u0439 \u043c\u0438\u0440\">\u0410\u043b\u044c\u0442\u0440\u0430\u043d\u0448\u0442\u0435\u0434\u0442\u0441\u043a\u0438\u0439 \u043c\u0438\u0440<\/a>, \u043f\u043e \u043a\u043e\u0442\u043e\u0440\u043e\u043c\u0443 \u043f\u043e\u0441\u043b\u0435\u0434\u043d\u0438\u0439 \u043e\u0442\u0440\u0435\u043a\u0430\u0435\u0442\u0441\u044f \u043e\u0442 \u043f\u043e\u043b\u044c\u0441\u043a\u043e\u0439 \u043a\u043e\u0440\u043e\u043d\u044b \u0432 \u043f\u043e\u043b\u044c\u0437\u0443 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D0%BD%D0%B8%D1%81%D0%BB%D0%B0%D0%B2_%D0%9B%D0%B5%D1%89%D0%B8%D0%BD%D1%81%D0%BA%D0%B8%D0%B9\" title=\"\u0421\u0442\u0430\u043d\u0438\u0441\u043b\u0430\u0432 \u041b\u0435\u0449\u0438\u043d\u0441\u043a\u0438\u0439\">\u0421\u0442\u0430\u043d\u0438\u0441\u043b\u0430\u0432\u0430 \u041b\u0435\u0449\u0438\u043d\u0441\u043a\u043e\u0433\u043e<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1724_%D0%B3%D0%BE%D0%B4\" title=\"1724 \u0433\u043e\u0434\">1724<\/a>&#160;\u2014 \u043e\u0441\u043d\u043e\u0432\u0430\u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B0%D1%80%D0%B8%D0%B6%D1%81%D0%BA%D0%B0%D1%8F_%D1%84%D0%BE%D0%BD%D0%B4%D0%BE%D0%B2%D0%B0%D1%8F_%D0%B1%D0%B8%D1%80%D0%B6%D0%B0\" title=\"\u041f\u0430\u0440\u0438\u0436\u0441\u043a\u0430\u044f \u0444\u043e\u043d\u0434\