u0433\u0443\u0431\u0435\u0440\u043d\u0438\u044f\">\u0413\u0440\u0443\u0437\u0438\u043d\u0441\u043a\u043e\u0439 \u0433\u0443\u0431\u0435\u0440\u043d\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1810_%D0%B3%D0%BE%D0%B4\" title=\"1810 \u0433\u043e\u0434\">1810<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%B0%D0%B4%D0%B8%D1%81%D1%81%D0%BA%D0%B8%D0%B5_%D0%BA%D0%BE%D1%80%D1%82%D0%B5%D1%81%D1%8B\" title=\"\u041a\u0430\u0434\u0438\u0441\u0441\u043a\u0438\u0435 \u043a\u043e\u0440\u0442\u0435\u0441\u044b\">\u041a\u0430\u0434\u0438\u0441\u0441\u043a\u0438\u0435 \u043a\u043e\u0440\u0442\u0435\u0441\u044b<\/a> \u0441\u043e\u0437\u0432\u0430\u043d\u044b \u0438 \u043f\u0440\u0438\u0432\u0435\u0434\u0435\u043d\u044b \u043a \u043f\u0440\u0438\u0441\u044f\u0433\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1812_%D0%B3%D0%BE%D0%B4\" title=\"1812 \u0433\u043e\u0434\">1812<\/a>&#160;\u2014 \u0432 \u0445\u043e\u0434\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%92%D0%BE%D0%B9%D0%BD%D0%B0_%D0%B7%D0%B0_%D0%BD%D0%B5%D0%B7%D0%B0%D0%B2%D0%B8%D1%81%D0%B8%D0%BC%D0%BE%D1%81%D1%82%D1%8C_%D0%90%D1%80%D0%B3%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D1%8B\" title=\"\u0412\u043e\u0439\u043d\u0430 \u0437\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u0410\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u044b\">\u0412\u043e\u0439\u043d\u044b \u0437\u0430 \u043d\u0435\u0437\u0430\u0432\u0438\u0441\u0438\u043c\u043e\u0441\u0442\u044c \u0410\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u044b<\/a> \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a class=\"external text\" href=\"https:\/\/es.wikipedia.org\/wiki\/Batalla_de_Tucum%C3%A1n\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0422\u0443\u043a\u0443\u043c\u0430\u043d\u0435<\/a> \u043c\u0435\u0436\u0434\u0443 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u043f\u0430\u0442\u0440\u0438\u043e\u0442\u043e\u0432 \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8C%D0%B3%D1%80%D0%B0%D0%BD%D0%BE,_%D0%9C%D0%B0%D0%BD%D1%83%D1%8D%D0%BB%D1%8C\" title=\"\u0411\u0435\u043b\u044c\u0433\u0440\u0430\u043d\u043e, \u041c\u0430\u043d\u0443\u044d\u043b\u044c\">\u041c\u0430\u043d\u0443\u044d\u043b\u044f \u0411\u0435\u043b\u044c\u0433\u0440\u0430\u043d\u043e<\/a> \u0438 \u043a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u043c\u0438 \u0432\u043e\u0439\u0441\u043a\u0430\u043c\u0438 \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B8%D1%81%D1%82%D0%B0%D0%BD,_%D0%9F%D0%B8%D0%BE_%D0%B4%D0%B5\" title=\"\u0422\u0440\u0438\u0441\u0442\u0430\u043d, \u041f\u0438\u043e \u0434\u0435\">\u0425\u0443\u0430\u043d\u0430 \u041f\u0438\u043e \u0434\u0435 \u0422\u0440\u0438\u0441\u0442\u0430\u043d\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1825_%D0%B3%D0%BE%D0%B4\" title=\"1825 \u0433\u043e\u0434\">1825<\/a>&#160;\u2014 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 <a class=\"external text\" href=\"https:\/\/es.wikipedia.org\/wiki\/Batalla_del_Rinc%C3%B3n\">\u0411\u0438\u0442\u0432\u0430 \u043f\u0440\u0438 \u0420\u0438\u043d\u043a\u043e\u043d<\/a> \u043f\u043e\u0431\u0435\u0434\u0443 \u0432 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u043e\u0434\u0435\u0440\u0436\u0430\u043b\u0438 \u043f\u043e\u0432\u0441\u0442\u0430\u043d\u0446\u044b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A2%D1%80%D0%B8%D0%B4%D1%86%D0%B0%D1%82%D1%8C_%D1%82%D1%80%D0%B8_%D0%9E%D1%80%D0%B8%D0%B5%D0%BD%D1%82%D0%B0%D0%BB%D0%B5%D1%81\" title=\"\u0422\u0440\u0438\u0434\u0446\u0430\u0442\u044c \u0442\u0440\u0438 \u041e\u0440\u0438\u0435\u043d\u0442\u0430\u043b\u0435\u0441\">\u0422\u0440\u0438\u0434\u0446\u0430\u0442\u044c \u0442\u0440\u0438 \u041e\u0440\u0438\u0435\u043d\u0442\u0430\u043b\u0435\u0441<\/a> \u043f\u043e\u0434 \u043a\u043e\u043c\u0430\u043d\u0434\u043e\u0432\u0430\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A0%D0%B8%D0%B2%D0%B5%D1%80%D0%B0,_%D0%A4%D1%80%D1%83%D0%BA%D1%82%D1%83%D0%BE%D1%81%D0%BE\" title=\"\u0420\u0438\u0432\u0435\u0440\u0430, \u0424\u0440\u0443\u043a\u0442\u0443\u043e\u0441\u043e\">\u0424\u0440\u0443\u043a\u0442\u0443\u043e\u0441\u043e \u0420\u0438\u0432\u0435\u0440\u0430<\/a> \u0438 \u043f\u043e\u0441\u043b\u0443\u0436\u0438\u0432\u0448\u0430\u044f \u043d\u0430\u0447\u0430\u043b\u043e\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D0%B3%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D0%BE-%D0%B1%D1%80%D0%B0%D0%B7%D0%B8%D0%BB%D1%8C%D1%81%D0%BA%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B9%D0%BD%D0%B0\" title=\"\u0410\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u043e-\u0431\u0440\u0430\u0437\u0438\u043b\u044c\u0441\u043a\u0430\u044f \u0432\u043e\u0439\u043d\u0430\">\u0410\u0440\u0433\u0435\u043d\u0442\u0438\u043d\u043e-\u0431\u0440\u0430\u0437\u0438\u043b\u044c\u0441\u043a\u043e\u0439 \u0432\u043e\u0439\u043d\u044b<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1830_%D0%B3%D0%BE%D0%B4\" title=\"1830 \u0433\u043e\u0434\">1830<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%91%D0%B5%D0%BB%D1%8C%D0%B3%D0%B8%D0%B9%D1%81%D0%BA%D0%B0%D1%8F_%D1%80%D0%B5%D0%B2%D0%BE%D0%BB%D1%8E%D1%86%D0%B8%D1%8F\" title=\"\u0411\u0435\u043b\u044c\u0433\u0438\u0439\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f\">\u0411\u0435\u043b\u044c\u0433\u0438\u0439\u0441\u043a\u0430\u044f \u0440\u0435\u0432\u043e\u043b\u044e\u0446\u0438\u044f<\/a>: \u0441\u043e\u0437\u0434\u0430\u043d\u043e <a class=\"external text\" href=\"https:\/\/en.wikipedia.org\/wiki\/Provisional_Government_of_Belgium\">\u0412\u0440\u0435\u043c\u0435\u043d\u043d\u043e\u0435 \u043f\u0440\u0430\u0432\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0411\u0435\u043b\u044c\u0433\u0438\u0438<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1838_%D0%B3%D0%BE%D0%B4\" title=\"1838 \u0433\u043e\u0434\">1838<\/a>&#160;\u2014 \u0412 \u0443\u0441\u0442\u044c\u0435 \u0440\u0435\u043a\u0438 \u0426\u0435\u043c\u0435\u0441 \u043d\u0430\u0447\u0430\u043b\u043e\u0441\u044c \u0441\u043e\u043e\u0440\u0443\u0436\u0435\u043d\u0438\u0435 \u0443\u043a\u0440\u0435\u043f\u043b\u0435\u043d\u0438\u044f, \u0432\u043e\u043a\u0440\u0443\u0433 \u043a\u043e\u0442\u043e\u0440\u043e\u0433\u043e \u0440\u0430\u0437\u0432\u0435\u0440\u043d\u0443\u043b\u043e\u0441\u044c \u0441\u0442\u0440\u043e\u0438\u0442\u0435\u043b\u044c\u0441\u0442\u0432\u043e \u0433\u043e\u0440\u043e\u0434\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%BE%D0%B2%D0%BE%D1%80%D0%BE%D1%81%D1%81%D0%B8%D0%B9%D1%81%D0%BA\" title=\"\u041d\u043e\u0432\u043e\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\">\u041d\u043e\u0432\u043e\u0440\u043e\u0441\u0441\u0438\u0439\u0441\u043a\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1852_%D0%B3%D0%BE%D0%B4\" title=\"1852 \u0433\u043e\u0434\">1852<\/a>&#160;\u2014 \u041f\u0435\u0440\u0432\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B8%D1%80%D0%B8%D0%B6%D0%B0%D0%B1%D0%BB%D1%8C\" title=\"\u0414\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u044c\">\u0434\u0438\u0440\u0438\u0436\u0430\u0431\u043b\u0435<\/a> \u0441 \u043f\u0430\u0440\u043e\u0432\u044b\u043c \u0434\u0432\u0438\u0433\u0430\u0442\u0435\u043b\u0435\u043c \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%80%D0%B0%D0%BD%D1%86%D1%83%D0%B7%D1%8B\" title=\"\u0424\u0440\u0430\u043d\u0446\u0443\u0437\u044b\">\u0444\u0440\u0430\u043d\u0446\u0443\u0437<\/a> <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%96%D0%B8%D1%84%D1%84%D0%B0%D1%80,_%D0%90%D0%BD%D1%80%D0%B8\" title=\"\u0416\u0438\u0444\u0444\u0430\u0440, \u0410\u043d\u0440\u0438\">\u0410\u043d\u0440\u0438 \u0416\u0438\u0444\u0444\u0430\u0440<\/a> (Baptiste Henry Jaques Giffard).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1869_%D0%B3%D0%BE%D0%B4\" title=\"1869 \u0433\u043e\u0434\">1869<\/a>&#160;\u2014 \u041d\u0430 \u0430\u043c\u0435\u0440\u0438\u043a\u0430\u043d\u0441\u043a\u043e\u043c \u0440\u044b\u043d\u043a\u0435 \u043f\u0440\u043e\u0438\u0437\u043e\u0448\u043b\u0430 \u043f\u0430\u043d\u0438\u043a\u0430 \u0438\u0437-\u0437\u0430 \u043c\u0430\u0441\u0441\u043e\u0432\u043e\u0439 \u0441\u043a\u0443\u043f\u043a\u0438 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%97%D0%BE%D0%BB%D0%BE%D1%82%D0%BE\" title=\"\u0417\u043e\u043b\u043e\u0442\u043e\">\u0437\u043e\u043b\u043e\u0442\u044b\u0445 \u0441\u043b\u0438\u0442\u043a\u043e\u0432<\/a> \u0434\u0432\u0443\u043c\u044f \u0431\u0438\u0437\u043d\u0435\u0441\u043c\u0435\u043d\u0430\u043c\u0438 (\u00ab\u0447\u0451\u0440\u043d\u0430\u044f \u043f\u044f\u0442\u043d\u0438\u0446\u0430\u00bb).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1893_%D0%B3%D0%BE%D0%B4\" title=\"1893 \u0433\u043e\u0434\">1893<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043d\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BF%D0%BF%D0%BE%D0%B4%D1%80%D0%BE%D0%BC\" title=\"\u0418\u043f\u043f\u043e\u0434\u0440\u043e\u043c\">\u0438\u043f\u043f\u043e\u0434\u0440\u043e\u043c\u0435<\/a> \u043d\u0430 \u0421\u0435\u043c\u0451\u043d\u043e\u0432\u0441\u043a\u043e\u043c \u043f\u043b\u0430\u0446\u0443 (\u043d\u044b\u043d\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B8%D0%BE%D0%BD%D0%B5%D1%80%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%BB%D0%BE%D1%89%D0%B0%D0%B4%D1%8C_(%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3)\" title=\"\u041f\u0438\u043e\u043d\u0435\u0440\u0441\u043a\u0430\u044f \u043f\u043b\u043e\u0449\u0430\u0434\u044c (\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433)\">\u041f\u0438\u043e\u043d\u0435\u0440\u0441\u043a\u0430\u044f \u043f\u043b\u043e\u0449\u0430\u0434\u044c<\/a>) \u043c\u0435\u0436\u0434\u0443 \u043a\u043e\u043c\u0430\u043d\u0434\u0430\u043c\u0438 \u00ab\u0421\u043f\u043e\u0440\u0442\u00bb \u0438 \u043f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0441\u043a\u0438\u043c \u043a\u0440\u0443\u0436\u043a\u043e\u043c \u0441\u043f\u043e\u0440\u0442\u0441\u043c\u0435\u043d\u043e\u0432 \u0441\u043e\u0441\u0442\u043e\u044f\u043b\u0430\u0441\u044c \u043e\u0434\u043d\u0430 \u0438\u0437 \u043f\u0435\u0440\u0432\u044b\u0445 \u0432 \u0420\u043e\u0441\u0441\u0438\u0438 \u0438\u0433\u0440 \u0432 \u00ab\u043d\u043e\u0436\u043d\u043e\u0439 \u043c\u044f\u0447\u00bb&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A4%D1%83%D1%82%D0%B1%D0%BE%D0%BB\" title=\"\u0424\u0443\u0442\u0431\u043e\u043b\">\u0444\u0443\u0442\u0431\u043e\u043b<\/a> .<\/li><\/ul><h3>XX \u0432\u0435\u043a <\/h3><ul><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1916_%D0%B3%D0%BE%D0%B4\" title=\"1916 \u0433\u043e\u0434\">1916<\/a>&#160;\u2014 \u0420\u0443\u0441\u0441\u043a\u0438\u0439 \u043b\u0451\u0442\u0447\u0438\u043a <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%90%D1%80%D1%86%D0%B5%D1%83%D0%BB%D0%BE%D0%B2,_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD_%D0%9A%D0%BE%D0%BD%D1%81%D1%82%D0%B0%D0%BD%D1%82%D0%B8%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0410\u0440\u0446\u0435\u0443\u043b\u043e\u0432, \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d \u041a\u043e\u043d\u0441\u0442\u0430\u043d\u0442\u0438\u043d\u043e\u0432\u0438\u0447\">\u041a.&#160;\u041a.&#160;\u0410\u0440\u0446\u0435\u0443\u043b\u043e\u0432<\/a> \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043f\u0440\u0435\u0434\u043d\u0430\u043c\u0435\u0440\u0435\u043d\u043d\u043e \u0432\u044b\u043f\u043e\u043b\u043d\u0438\u043b \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A8%D1%82%D0%BE%D0%BF%D0%BE%D1%80_(%D0%B0%D0%B2%D0%B8%D0%B0%D1%86%D0%B8%D1%8F)\" class=\"mw-redirect\" title=\"\u0428\u0442\u043e\u043f\u043e\u0440 (\u0430\u0432\u0438\u0430\u0446\u0438\u044f)\">\u0448\u0442\u043e\u043f\u043e\u0440<\/a>\u00bb \u0438 \u0432\u044b\u0432\u0435\u043b \u0438\u0437 \u043d\u0435\u0433\u043e <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BC%D0%BE%D0%BB%D1%91%D1%82\" title=\"\u0421\u0430\u043c\u043e\u043b\u0451\u0442\">\u0441\u0430\u043c\u043e\u043b\u0451\u0442<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932_%D0%B3%D0%BE%D0%B4\" title=\"1932 \u0433\u043e\u0434\">1932<\/a>&#160;\u2014 \u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%98%D0%BD%D0%B4%D0%B8%D1%8F\" title=\"\u0418\u043d\u0434\u0438\u044f\">\u0418\u043d\u0434\u0438\u0438<\/a> \u043f\u0440\u0430\u0432\u043e \u0443\u0447\u0430\u0441\u0442\u0438\u044f \u0432 \u0432\u044b\u0431\u043e\u0440\u0430\u0445 \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u043b\u0435\u043d\u043e \u043a\u0430\u0441\u0442\u0435 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9D%D0%B5%D0%BF%D1%80%D0%B8%D0%BA%D0%B0%D1%81%D0%B0%D0%B5%D0%BC%D1%8B%D0%B5_(%D0%B2%D0%B0%D1%80%D0%BD%D0%B0)\" class=\"mw-redirect\" title=\"\u041d\u0435\u043f\u0440\u0438\u043a\u0430\u0441\u0430\u0435\u043c\u044b\u0435 (\u0432\u0430\u0440\u043d\u0430)\">\u043d\u0435\u043f\u0440\u0438\u043a\u0430\u0441\u0430\u0435\u043c\u044b\u0445<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1934_%D0%B3%D0%BE%D0%B4\" title=\"1934 \u0433\u043e\u0434\">1934<\/a>&#160;\u2014 \u0413\u0430\u0437\u0435\u0442\u0430 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D1%80%D0%B0%D0%B2%D0%B4%D0%B0_(%D0%B3%D0%B0%D0%B7%D0%B5%D1%82%D0%B0)\" title=\"\u041f\u0440\u0430\u0432\u0434\u0430 (\u0433\u0430\u0437\u0435\u0442\u0430)\">\u041f\u0440\u0430\u0432\u0434\u0430<\/a>\u00bb \u0432\u043f\u0435\u0440\u0432\u044b\u0435 \u043d\u0430\u0437\u0432\u0430\u043b\u0430 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D0%B0%D0%BB%D0%B8%D0%BD,_%D0%98%D0%BE%D1%81%D0%B8%D1%84_%D0%92%D0%B8%D1%81%D1%81%D0%B0%D1%80%D0%B8%D0%BE%D0%BD%D0%BE%D0%B2%D0%B8%D1%87\" title=\"\u0421\u0442\u0430\u043b\u0438\u043d, \u0418\u043e\u0441\u0438\u0444 \u0412\u0438\u0441\u0441\u0430\u0440\u0438\u043e\u043d\u043e\u0432\u0438\u0447\">\u0421\u0442\u0430\u043b\u0438\u043d\u0430<\/a> \u00ab\u0412\u0435\u043b\u0438\u043a\u0438\u043c \u043a\u043e\u0440\u043c\u0447\u0438\u043c\u00bb.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1938_%D0%B3%D0%BE%D0%B4\" title=\"1938 \u0433\u043e\u0434\">1938<\/a>&#160;\u2014 \u0416\u0435\u043d\u0441\u043a\u0438\u0439 \u044d\u043a\u0438\u043f\u0430\u0436 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%93%D1%80%D0%B8%D0%B7%D0%BE%D0%B4%D1%83%D0%B1%D0%BE%D0%B2%D0%B0,_%D0%92%D0%B0%D0%BB%D0%B5%D0%BD%D1%82%D0%B8%D0%BD%D0%B0_%D0%A1%D1%82%D0%B5%D0%BF%D0%B0%D0%BD%D0%BE%D0%B2%D0%BD%D0%B0\" title=\"\u0413\u0440\u0438\u0437\u043e\u0434\u0443\u0431\u043e\u0432\u0430, \u0412\u0430\u043b\u0435\u043d\u0442\u0438\u043d\u0430 \u0421\u0442\u0435\u043f\u0430\u043d\u043e\u0432\u043d\u0430\">\u0412.&#160;\u0421.&#160;\u0413\u0440\u0438\u0437\u043e\u0434\u0443\u0431\u043e\u0432\u043e\u0439<\/a> \u0441\u043e\u0432\u0435\u0440\u0448\u0438\u043b \u0431\u0435\u0441\u043f\u043e\u0441\u0430\u0434\u043e\u0447\u043d\u044b\u0439 \u043f\u043e\u043b\u0451\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%BE%D1%81%D0%BA%D0%B2%D0%B0\" title=\"\u041c\u043e\u0441\u043a\u0432\u0430\">\u041c\u043e\u0441\u043a\u0432\u0430<\/a>&#160;\u2014 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%94%D0%B0%D0%BB%D1%8C%D0%BD%D0%B8%D0%B9_%D0%92%D0%BE%D1%81%D1%82%D0%BE%D0%BA\" title=\"\u0414\u0430\u043b\u044c\u043d\u0438\u0439 \u0412\u043e\u0441\u0442\u043e\u043a\">\u0414\u0430\u043b\u044c\u043d\u0438\u0439 \u0412\u043e\u0441\u0442\u043e\u043a<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1944_%D0%B3%D0%BE%D0%B4\" title=\"1944 \u0433\u043e\u0434\">1944<\/a>&#160;\u2014 \u041e\u0